Hi guys, here is my tutorial on using the Revlon One Step Volumiser. Just to say I’m not an expert this is just the way I use the tool to create my at home blow dry.

A few points I missed out 
- to create volume, with your section of hair brush upwards at the root to create that lift and volume 
- if you have time instead of rough drying with a hairdryer, leaving your hair to dry to 80-90% naturally is better 
- keep practicing!!

If you have any questions pop them below :)

